import React, {Component} from "react";
// import App from "../App";

export default class Secret extends Component {
    render(){
        return(
        <div>
            This is a super secret area. Jump back to <a href="/">Home</a>
            <br/>
            <button>Logout</button>
        </div>
        );

    }
}
